import Card from "./Card"
import {FaGamepad} from 'react-icons/fa';
import {FaSnapchatGhost} from 'react-icons/fa';

const Projects = () => {
    return (
        <section id="projects">
            <Card title="Snake" icon = {<FaGamepad className="faLogo"/>} 
            description="Classic Snake game with customizable difficulty."/>
            <Card title="BYOM" icon = {<FaSnapchatGhost className="faLogo"/>} 
            description="IOS app built during Snapchat Developer Challenge via Snapchat OAuth;
                         Allows users to use custom stickers within Snapchat, exploring a wide range
                         of spontaneous activities."/>
        </section>
    )
}

export default Projects
